import './App.css';
import {Route, Routes, BrowserRouter} from 'react-router-dom'
import Home from './components/Home';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
    <Routes>
      <Route component={ Home } path="/" exact/>
      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
